import React from "react";
import { Card, CardContent } from "../../../../components/ui/card";

// Import the colored image
import coloredImage from "../../../../photos/Votre_sit.._colored.png";

export const ServicesSection = () => {
  const services = [
    {
      id: 1,
      number: "1",
      titleEn: "Tailor-Made\nWebsites",
      titleFr: "Votre site web sur\nmesure",
    },
    {
      id: 2,
      number: "2",
      titleEn: "Web & Mobile\nDevelopment",
      titleFr: "Développement web et mobile sur mesure",
    },
    {
      id: 3,
      number: "3",
      titleEn: "UI/UX &\nBranding",
      titleFr: "L'expérience utilisateur au cœur de votre identité",
    },
    {
      id: 4,
      number: "4",
      titleEn: "Digital System\nMaintenance",
      titleFr: "Des systèmes digitaux performants et sécurisés",
    },
    {
      id: 5,
      number: "5",
      titleEn: "E-Commerce\nSolutions",
      titleFr: "Boostez vos ventes en ligne",
    },
    {
      id: 6,
      number: "6",
      titleEn: "AI &\nAutomation",
      titleFr: "L'intelligence artificielle au service de votre entreprise",
    },
  ];

  const handleContact = () => {
    console.log("Contact button clicked");
  };

  return (
    <section className="w-full max-w-[1242px] mx-auto py-16">
      <div className="flex flex-col items-center mb-12">
        <h2 className="font-['Montserrat'] font-bold text-white text-[40px]">
          Nos Services
        </h2>
        <img
          className="w-[246px] h-[22px] mt-3"
          alt="Decorative underline"
          src="https://c.animaapp.com/mbefdp65f3u1c4/img/vector-2046.svg"
        />
      </div>

      <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-9">
        {services.map((service) => (
          <div key={service.id} className="w-[400px] h-[200px] overflow-hidden cursor-pointer group">
            <div className="relative w-full h-full rounded-[24px] bg-[#0a0a0a] transition-transform duration-300 group-hover:scale-[1.02]">
              {/* Main color fill - smooth bottom to top */}
              <div
                className="absolute bottom-0 left-0 right-0 rounded-[24px] h-0 group-hover:h-full transition-all duration-1000 ease-[cubic-bezier(0.4,0,0.2,1)]"
                style={{ backgroundColor: "#c1ff00" }}
              />

              {/* Content container */}
              <div className="relative z-10 w-full h-full p-8 flex items-center">
                {/* Large number */}
                <div className="absolute left-8 top-0 bottom-0 flex items-center">
                  <div className="relative">
                    {/* Dark version - gradient number from white to black */}
                    <span
                      className="absolute leading-none transition-all duration-800 ease-out group-hover:opacity-0 font-['Montserrat']"
                      style={{
                        fontSize: "250px",
                        fontWeight: 300,
                        lineHeight: "100%",
                        letterSpacing: "0%",
                        verticalAlign: "middle",
                        background: "linear-gradient(to bottom, #fff 0%, #000 500%)",
                        WebkitBackgroundClip: "text",
                        WebkitTextFillColor: "transparent",
                      }}
                    >
                      {service.number}
                    </span>

                    {/* Bright version - solid black "1" */}
                    <span
                      className="leading-none transition-all duration-800 ease-out opacity-0 group-hover:opacity-100 text-black font-['Montserrat']"
                      style={{
                        fontSize: "250px",
                        fontWeight: 300,
                        lineHeight: "100%",
                        letterSpacing: "0%",
                        verticalAlign: "middle",
                      }}
                    >
                      {service.number}
                    </span>
                  </div>
                </div>

                {/* Content section */}
                <div className="ml-[140px] flex flex-col items-start justify-center">
                  {/* Text content */}
                  <div className="relative h-20 mb-4 w-full">
                    {/* Dark version text */}
                    <h2
                      className="absolute top-0 left-0 text-white text-2xl whitespace-pre-line text-left font-['Montserrat'] font-bold transition-all duration-600 ease-out group-hover:opacity-0 group-hover:translate-y-[-10px]"
                      style={{ lineHeight: 1.2, maxWidth: '200px' }}
                    >
                      {service.titleEn}
                    </h2>

                    {/* Bright version text */}
                    <h2
                      className="absolute top-0 left-0 ml-9 -mt-6  text-black text-xl whitespace-pre-line text-left font-['Montserrat'] font-bold transition-all duration-600 ease-out opacity-0 translate-y-[10px] group-hover:opacity-100 group-hover:translate-y-0 delay-200"
                      style={{ lineHeight: 1.2, maxWidth: '200px' }}
                    >
                      {service.titleFr}
                    </h2>
                  </div>

                  {/* Contact button */}
                  <button
                    onClick={handleContact}
                    className="bg-black text-[#c1ff00] px-5 py-2 ml-9 rounded-full transition-all duration-500 ease-out opacity-0 translate-y-4 group-hover:opacity-100 group-hover:translate-y-0 delay-400 font-['Montserrat'] font-semibold text-sm"
                  >
                    Contactez-nous
                  </button>
                </div>
              </div>
            </div>
          </div>
        ))}
      </div>

      <Card className="w-full h-[300px] mt-[146px] bg-black rounded-[45px] backdrop-blur-[7.5px] backdrop-brightness-[100%] [-webkit-backdrop-filter:blur(7.5px)_brightness(100%)] border-0">
        <CardContent className="p-0 flex flex-col md:flex-row items-center h-full">
          <div className="relative w-[387px] h-56 ml-[75px] mt-[21px]">
            <div className="absolute w-[275px] top-8 left-0 font-['Montserrat'] font-medium text-white text-[90px] leading-[96.4px]">
              Offre
              <br />
              20%
            </div>
            <div className="absolute w-[173px] h-[166px] top-5 left-[196px] rotate-[15deg]">
              <div className="absolute w-11 h-[87px] top-0 left-5 bg-black rounded-[21.84px/43.68px]" />
              <div className="absolute w-11 h-[87px] top-0 left-[109px] bg-black rounded-[21.84px/43.68px]" />
              <div className="absolute w-[180px] h-[115px] top-[90px] -left-1">
                <img
                  className="absolute w-[161px] h-[76px] top-5 left-[9px] rotate-[-15deg]"
                  alt="Vector"
                  src="https://c.animaapp.com/mbefdp65f3u1c4/img/vector-2039.svg"
                />
                <img
                  className="absolute w-[19px] h-[19px] top-[30px] left-0.5 rotate-[-15deg]"
                  alt="Vector"
                  src="https://c.animaapp.com/mbefdp65f3u1c4/img/vector-2040.svg"
                />
                <img
                  className="absolute w-[19px] h-[19px] top-[30px] left-[159px] rotate-[-15deg]"
                  alt="Vector"
                  src="https://c.animaapp.com/mbefdp65f3u1c4/img/vector-2041.svg"
                />
              </div>
            </div>
          </div>
          <div className="w-[644px] mt-[74px] ml-[83px] font-['Montserrat'] font-normal text-[40px]">
            <span className="text-white">Profitez de </span>
            <span className="font-medium text-white">20%</span>
            <span className="text-white">
              {" "}
              de réduction sur votre premier trimestre, et une consultation{" "}
            </span>
            <span className="font-medium text-white">gratuite!</span>
          </div>
        </CardContent>
      </Card>
    </section>
  );
};
